import React, { Component } from "react";

class Header extends Component {
  render() {
    return (
      <header>
        <h1 onclick="location.href='/board/list'">IRS</h1>
        <div>Information Recording Site</div>
        <nav>
          <ul>
            <li onclick="location.href='/board/list'">Information</li>
            <li onclick="location.href='/notice'">Notice</li>
          </ul>
        </nav>
    </header>
    );
  }
}

export default Header;
